import TreeView from "treeview-react-bootstrap/src";

let data = [
    {
        text: "Parent 1",
        nodes: [
            {
                text: "Child 1",
                nodes: [
                    {
                        text: "Grandchild 1"
                    },
                    {
                        text: "Grandchild 2"
                    }
                ]
            },
            {
                text: "Child 2"
            }
        ]
    },
    {
        text: "Parent 2"
    }
];

export const Menu = () => {
    return (
        <TreeView data={data} />
    )
}
